script: |
  super -f text -I q13423.spq | sort > q13423.out

inputs:
  - name: q13423.spq
    data: |
      SELECT - col1 / col0 + + 35 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - + ( + + 74 ) BETWEEN - - col1 AND 88;
  - name: tab1

outputs:
  - name: q13423.out
    data: |
      35
      35
      35
